Alexis Grace, Barrett Blade, Briana Blair , Derrick Pierce, Jenaveve Jolie, Kaylani Lei, Rocco Reed

Jackie's (Kaylani Lei) job is to get couples back together. But when her roommate Sophia (Briana Blair) asks her to get her back her man, Jackie soon discovers that she wants to keep him all for herself. Will it blow up in Jackie's face, or can she manage to keep both her best friend and her new fuck buddy?
